import React, { useEffect } from "react";

export default function ProductList() {
  useEffect(() => {
    (async () => {
      const res = await fetch(
        "http://localhost:5000/api/category/id/1?limit=10"
      );
      const resultText = await res.text(); // Read the response body as text
      const result = JSON.parse(resultText);

      console.log(result);
    })().then((res) => console.log(res));
  }, []);
  return (
    <>
      <h1>product list</h1>
    </>
  );
}
